Actionscript.script:
import flash.display.MovieClip;
import flash.display.BitmapData;
import flash.display.Bitmap;
import flash.geom.Matrix;
import fl.motion.Color;
import flash.events.Event;

var clip:MovieClip = new ClipToDraw();

var r:Number = 0;
var fx:Number = 0;
var fy:Number = 0;

/*
To illustrate the second (optional) matrix parameter of the BitmapData.draw
method, we create a second larger BitmapData object, 'bd2', filled with white,
create a corresponding Bitmap, 'bitmap2', and add it to the Display List.
*/

var bd2:BitmapData = new BitmapData(300,300,true,0x00000000);
var bitmap2:Bitmap = new Bitmap(bd2);
this.addChild(bitmap2);

bitmap2.x = 150;
bitmap2.y = 50;

var mat:Matrix = new Matrix();
//mat.rotate(-45);
//mat.scale(2, 2);
mat.translate(50 / 2, 50 / 2);

bd2.draw(clip, mat);

log.text = "";

ma.text = mat.a.toString();
mb.text = mat.b.toString();
mc.text = mat.c.toString();
md.text = mat.d.toString();

function updateLog():void {
	rotations.text = "Rotations Applied: " + r.toString();
	xflips.text = "X Flips Applied: " + fx.toString();
	yflips.text = "Y Flips Applied: " + fy.toString();
	log.appendText("matrix [ a:"+mat.a+" b:"+mat.b+" c:"+mat.c+" d:"+mat.d+" ] ,rotated "+r+" times ("+(r*90).toString()+") degrees, flipped: (Hor "+fx+" , Vert "+fy+" ) times\n");
}
function updateLogCustom():void {
	log.appendText('matrix {"ma":'+mat.a+', "mb":'+mat.b+', "mc":'+mat.c+', "md":'+mat.d+', "name":"'+txtname.text+'"}'+"\n");
}

function rotate_click(e:Event):void {
	mat.rotate(Math.PI / 2);
	var tx = 0 * 50 + 50 / 2;
	var ty = 0 * 50 + 50 / 2;
	mat.tx = tx;
	mat.ty = ty;
	bd2.fillRect(bd2.rect, 0x000000);
	bd2.draw(clip, mat);
	r++;
	updateLog();
}
rotate.addEventListener("click", rotate_click);

function flipx_click(e:Event):void {
	mat.scale(-1, 1);
	var tx = 0 * 50 + 50 / 2;
	var ty = 0 * 50 + 50 / 2;
	mat.tx = tx;
	mat.ty = ty;
	bd2.fillRect(bd2.rect, 0x000000);
	bd2.draw(clip, mat);
	fx++;
	updateLog();
}
flipx.addEventListener("click", flipx_click);

function flipy_click(e:Event):void {
	mat.scale(1, -1);
	var tx = 0 * 50 + 50 / 2;
	var ty = 0 * 50 + 50 / 2;
	mat.tx = tx;
	mat.ty = ty;
	bd2.fillRect(bd2.rect, 0x000000);
	bd2.draw(clip, mat);
	fy++;
	updateLog();
}
flipy.addEventListener("click", flipy_click);

function reset_click(e:Event):void {
	mat = new Matrix();
	mat.translate(50 / 2, 50 / 2);
	r = 0;
	fx = 0;
	fy = 0;
	rotations.text = "Rotations Applied: " + r.toString();
	xflips.text = "X Flips Applied: " + fx.toString();
	yflips.text = "Y Flips Applied: " + fy.toString();
	bd2.fillRect(bd2.rect, 0x000000);
	bd2.draw(clip, mat);
	//updateLog();
	//log.text = "";
}
reset.addEventListener("click", reset_click);

function clear_click(e:Event):void {
	//updateLog();
	log.text = "";
}
clear.addEventListener("click", clear_click);

function applyCustom_click(e:Event):void {
	mat.a = Number(ma.text);
	mat.b = Number(mb.text);
	mat.c = Number(mc.text);
	mat.d = Number(md.text);
	bd2.fillRect(bd2.rect, 0x000000);
	bd2.draw(clip, mat);
}
applyCustom.addEventListener("click", applyCustom_click);

function logCustom_click(e:Event):void {
	updateLogCustom();
}
logCustom.addEventListener("click", logCustom_click);
